import React from "react";
import navCode from "../assets/file-code.svg";
import navWork from "../assets/briefcase.svg";
import navAbout from "../assets/file-earmark-person.svg";
import navContact from "../assets/phone.svg";
import { BsFileCode } from "react-icons/bs";
import { BsBriefcaseFill } from "react-icons/bs";
import { BsFillFileEarmarkPersonFill } from "react-icons/bs";
import { BsFillPhoneFill } from "react-icons/bs";

function NavModal({ navModal }) {


  return (
    <div id="navModal">
      <div className="navButtonCode">
        <img src={BsFileCode} id="navCode" style={{color: "#ffffff"}} alt="Navigation Bar Button Code" />
      </div>
      <div className="navButtonWork">
        <img src={BsBriefcaseFill} id="navWork" alt="Navigation Bar Button Work" />
      </div>
      <div className="navButtonAbout">
        <img src={BsFillFileEarmarkPersonFill} id="navAbout" alt="Navigation Bar Button About" />
      </div>
      <div className="navButtonContact">
        <img
          src={BsFillPhoneFill}
          id="navContact"
          alt="Navigation Bar Button Contact"
        />
      </div>
    </div>
  );
}

export default NavModal;
